import React from "react";

function WriteReviewBox() {
  return (
    <div className="write-review-box">
      <form>
        <label>Title</label>
        <input type="text"></input>
        <label>Content</label>
        <input type="text"></input>
      </form>
    </div>
  )
}

export default WriteReviewBox;
